import React from "react";
import "./Rightbar.css";

const Rightba = () => {
  return <div className="rightbar">
    <div className="rightbarWrapper">
      <div className="eventContainer">
        <img src="" alt="" className="starImg" />
        <span className="eventText">
          <b>フォロワー限定</b>いべんとかいさ
        </span>
      </div>
    </div>
  </div>;
};

export default Rightba;
